import React from 'react';
import { View } from 'react-native';
import { TextInput, Title, Text, Button } from 'react-native-paper';
import SubmitButton from './SubmitButton.js';
import FormTextBox from './FormTextBox.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './styles.css';

class Home extends React.Component{

    state = {
        username: '',
        password: ''
    };

    login() {
        alert('pressed');
    }

    isFilledOut(){
        if(this.state.username == '' && this.state.password == ''){
            return false;
        } else {
            return true;
        }
    }

    changeUsernameText(){
        username => this.setState({ username });
        this.isFilledOut;
    }

    render() {
        return(
            <div className="fullpage">
                <Container>
                    <Row className="main">
                        <Col md={{ span: 4, offset: 4 }}>
                            <Title>Welcome, Login!</Title>
                            <TextInput label='Username' value={this.state.username} onChangeText={this.changeUsernameText} />
                            <TextInput label='password' value={this.state.password} onChangeText={password => this.setState({ password })} />
                            <Button mode="contained" onPress={this.login} disabled={this.isFilledOut}>Login</Button>
                            <Text>{"Don't have an account?"}</Text>
                            <a href="">Create an account</a>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
